  input: 'TEXT,F3XA,,"What may appear to have been over-transfers from non-federal
    accounts to our federal allocation account are explained as follows: (1) two transfers
    (3/3/05 and 3/4/05) were in excess of the amounts ultimately determined to be
    appropriately allocable to the non-federal account because of changes in the ratios
    for the Lincoln Day Dinner fund-raising event from the time the original transfer
    amounts were estimated to the time when the ratios were re-computed based on the
    proportion of receipts for this fundraiser from non-federal accounts versus federal
    account; and (2) one transfer ($10,000 on 3/7/05) was made in anticipation of
    Lincoln Day Dinner expenses that then unexpectdly were not paid. Compensationg
    adjustmens were made to reduce subsequent transfers from the non-federal accounts
    so that the over-transfers were effectively reversed in the following two months,
    as shown in a schedule being submitted under cover of our January 27, 2006 letter.
    As previously explained, our Committee maintains a separate allocation checking
    account as part of our overall federal account through which allocable expenditures
    are paid so that monies transferred from the non-federal accounts to this separate
    allocation checking account are kept separate from other federal account monies.
    A more detailed explanation appears in our letter dated Jan.27,06 responding to
    Mr. Morse''s"'
